description:
When Clark Griswold puts his mind to something, we soon realize he hasn\'t got one. Still, nothing stops him when the vacation bug hits. This time, he\'s chosen Las Vegas, the new family entertainment capital of America! Chevy Chase returns as bubbly, bumbling Clark in Vegas Vacation, a jokers-are-wild laugh fest including two other stars from past Vacations. Beverly D\'Angelo is back as wife Ellen, doting on the guy she calls \&quot;Sparky,\&quot; and Randy Quaid again delights as grubby goof ball Cousin Eddie. Ethan Embry (That Thing You Do!) and screen-debuting Marisol Nichols are Griswold teens who love the round-the-clock nightlife - as long as they don\'t share it with Mom and Dad! From Seigfried and Roy\'s extravaganza to a Hoover Dam tour, from cruising to losing (Wallace Shawn as a shifty blackjack dealer) to amorous crooning (Wayne Newton falls for Ellen): watch Clark try to keep family and wallet together!
